import { Box, Button, Container, Grid, Hidden, TextField } from "@material-ui/core";
import React from "react";
import { useStyles } from "./BodyStyle";
import image from "../../images/aboutSide.jpg";
import { RenderSectionHeading, CardMedia } from "../common/Common";
import AcUnitIcon from "@mui/icons-material/AcUnit";
import DeveloperModeIcon from "@mui/icons-material/DeveloperMode";
import GifIcon from "@mui/icons-material/Gif";
import DashboardIcon from "@mui/icons-material/Dashboard";
//import ScrollAnimation from 'react-animate-on-scroll';

export default function Comment() {
  const classes = useStyles();

  return (
    <Box className={classes.section} id="Comments">
      {/* <ScrollAnimation animateIn='fadeIn'> */}
      <Container>
        <Grid container spacing={1}>
          <Grid item sm={5}>
            <Box component={Hidden} xsDown>
              <img
                src={image}
                alt=" about us"
                className={classes.responsiveImg}
              />
            </Box>
          </Grid>
          <Grid item xs={12} sm={7}>
            {RenderSectionHeading({
              smallText: "Make a Comment!",
              heading: "Comment Section has been designed for you..",
              description: "We are always open for your feedbacks! ",
            })}
                      <br />
                      <form>
            <Grid container spacing={2} direction="">
                          <Grid item xs={12}>
                              <TextField id="outlined-basic" label="Outlined" variant="outlined" />
                              <TextField id="outlined-basic" label="Mail" variant="outlined" />
                              <TextField id="outlined-basic" label="Leave a Comment" variant="outlined" />
                              <Button>Submit</Button>

              </Grid>
            </Grid>
            </form>
          </Grid>
        </Grid>
      </Container>
      {/* </ScrollAnimation> */}
    </Box>
  );
}
